import './App.css';
import '../number-keyboard/number-keyboard.css';
import Keyboard from '../number-keyboard/number-keyboard';
import Button from '../button/button';

function App() {
  return (
    <div className="calculator">     
        <h1>CALCULATOR</h1>  
        <div className="calculator">     
        <Keyboard min={0} max={9} />
        <Button text="+" />
        </div>
    </div>
  );
}

export default App;
